import attr
from attr import validators

# Test that gt actually works as "greater than" (not "greater than or equal")
@attr.s
class MyClass:
    value = attr.ib(validator=validators.gt(10))

# Test values that should work (values > 10)
try:
    obj1 = MyClass(11)
    print("✓ MyClass(11) works - value greater than 10")
except ValueError as e:
    print(f"✗ MyClass(11) failed: {e}")

try:
    obj2 = MyClass(100)
    print("✓ MyClass(100) works - value greater than 10")
except ValueError as e:
    print(f"✗ MyClass(100) failed: {e}")

# Test value that should fail (value == 10, not greater than)
try:
    obj3 = MyClass(10)
    print("✗ MyClass(10) works - but should fail (value equal to 10)")
except ValueError as e:
    print(f"✓ MyClass(10) correctly failed: {e}")

# Test value that should fail (value < 10)
try:
    obj4 = MyClass(5)
    print("✗ MyClass(5) works - but should fail (value less than 10)")
except ValueError as e:
    print(f"✓ MyClass(5) correctly failed: {e}")

print("\nConfirming: validators.gt is working correctly as 'greater than',")
print("but its docstring incorrectly says it uses operator.ge")
